from heapq import heappush, heappop

class Solution(object):
	def minStepMaze(self, maze, start, des):
		dirs = [(-1, 0), (0, -1), (1, 0), (0, 1)]
		m, n = len(maze), len(maze[0])
		q = [(0, start[0], start[1])]
		# maze[start[0]][start[1]] = 2
		while q:
			d, r, c = heappop(q)
			if maze[r][c] == 2:
				continue
			if des[0] == r and des[1] == c:
				return d
			maze[r][c] = 2

			for dr, dc in dirs:
				newR = r + dr
				newC = c + dc
				if 0 <= newR < m and 0 <= newC < n and maze[newR][newC] == 0:
					# maze[newR][newC] = 2
					heappush(q, (d + 1, newR, newC))
		return -1


